contract Book
{
    string public bookTitle;
    uint public bookID;
    address public seller;

    constructor(uint _bookID, string memory _bookTitle, address _seller) public payable
    {
        bookID = _bookID;
        bookTitle = _bookTitle;
        seller = _seller;
    }
}

contract BookFactory
{
    // array of book contracts
    Book[] public books;

    function newBook(string memory _bookTitle) public
    {
        // pointer to book contract
        Book book = new Book(books.length-1, _bookTitle, address(this));

        // push book contract pointer to array
        books.push(book);
    }

    // function newBook(string memory _bookTitle) public payable
